import CBadge from "src/Components/UI/Badge/CBadge";

const OTableBody = (props) => {
  const data = props.body;
  console.log(data[0].customer_details.firstName, "hi");
  //   for (let key in data[0].customer_details) {
  //     console.log(key);
  //   }
  return (
    <>
      {data.map((row, i) => {
        return (
          <tr key={i}>
            <td>{row.id}</td>
            <td>{row.order_id}</td>
            <td>{getCustomerName(row.customer_details)}</td>
            <td>{row.amount}</td>
            <td>{getStatus(row.status)}</td>
            <td>{row.pay_method}</td>
            <td></td>
          </tr>
        );
      })}
    </>
  );
};
export default OTableBody;

const getCustomerName = (data) => {
  return `${data.firstName} ${data.lastName}`;
};

const getStatus = (status) => {
  switch (status) {
    case "paid":
      return <CBadge color="success" value="Paid" />;
    default:
      return false;
  }
};
const getethod = (method) => {
  switch (method) {
    case "credit_card":
      return <CBadge color="Danger" value="Credit Card" />;
    case "stripe":
      return <CBadge color="Danger" value="Stripe Payment" />;
    case "stripe":
      return <CBadge color="Danger" value="Stripe Payment" />;
  }
};
